import React from 'react';

const Legend = ({ title, items }) => {
  return (
    <div className="legend-container">
      {title && <h4 className="legend-title">{title}</h4>}
      <div className="legend-items">
        {items.map((item, index) => (
          <div key={index} className="legend-item" style={item.style}>
            {item.icon && <span className="legend-icon">{item.icon}</span>}
            {item.color && <span className="legend-color-box" style={{ backgroundColor: item.color }}></span>}
            <span className="legend-label">{item.label}</span>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Legend;
